import React from 'react';
import ContentCard from './ContentCard';

export default function ContentGrid({ items }) {
  return (
    <div className="grid-wrapper">
      {items.map((it) => (
        <ContentCard key={it.id || `${it.userName}-${it.title}`} item={it} />
      ))}
    </div>
  );
}
